import React from 'react'

export const Item = ( {element} ) => {
  return (
    <div >
        <img src={element.image} alt="" />
        <h2>{element.nombre}</h2>
        <h3>{element.description}</h3>
        <h3>{element.price}</h3>
    </div>
  )
}
